import PropTypes from "prop-types";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-auto-tabpanel-${index}`}
      aria-labelledby={`scrollable-auto-tab-${index}`}
      {...other}
    >
      <Box p={3}>{children}</Box>
    </Typography>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired
};

function a11yProps(index) {
  return {
    id: `scrollable-auto-tab-${index}`,
    "aria-controls": `scrollable-auto-tabpanel-${index}`
  };
}

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    width: "100%",
    backgroundColor: theme.palette.background.paper
  }
}));

export default function ScrollableTabsButtonAuto() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const sushis = [
    { id: 1, item: "Tuna" },
    { id: 2, item: "Salmon" },
    { id: 3, item: "Escolar (Ono)" },
    { id: 4, item: "Albacore" },
    { id: 5, item: "Halibut" },
    { id: 6, item: "Yellowtail" },
    { id: 7, item: "Shrimp" },
    { id: 8, item: "White Fish" },
    { id: 9, item: "Crab" },
    { id: 10, item: "Red Clam" },
    { id: 11, item: "Octopus" },
    { id: 12, item: "Egg" },
    { id: 13, item: "Smelt Egg" },
    { id: 14, item: "Squid" },
    { id: 15, item: "Fresh Water Eel" },
    { id: 16, item: "Salmon Egg" },
    { id: 17, item: "Ocean Striped Bass" },
    { id: 18, item: "Scallop" },
    { id: 19, item: "Mackerel" }
  ];
  const listSushis = sushis.map(sushi => <li>{sushi}</li>);

  return (
    <div className={classes.root}>
      <AppBar position="static" color="default">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          variant="scrollable"
          scrollButtons="auto"
          aria-label="scrollable auto tabs example"
        >
          <Tab label="Sushi" {...a11yProps(0)} />
          <Tab label="Regular Rolls" {...a11yProps(1)} />
          <Tab label="Fresh Rolls" {...a11yProps(2)} />
          <Tab label="Tempura Rolls" {...a11yProps(3)} />
          <Tab label="Baked Rolls" {...a11yProps(4)} />
          <Tab label="Specialty Item" {...a11yProps(5)} />
          <Tab label="Appetizers" {...a11yProps(6)} />
          <Tab label="Kitchen" {...a11yProps(7)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
        <ul>{listSushis}</ul>
      </TabPanel>
      <TabPanel value={value} index={1}>
        Item Two
      </TabPanel>
      <TabPanel value={value} index={2}>
        Item Three
      </TabPanel>
      <TabPanel value={value} index={3}>
        Item Four
      </TabPanel>
      <TabPanel value={value} index={4}>
        Item Five
      </TabPanel>
      <TabPanel value={value} index={5}>
        Item Six
      </TabPanel>
      <TabPanel value={value} index={6}>
        Item Seven
      </TabPanel>
    </div>
  );
}
